import "../../CSS/imager_settings.css";
import React, { useEffect } from "react";
import { ReactComponent as FieldDockLogo } from "../../assets/FieldDock-Logo.svg";

function Imager_Settings() {
  // --------------------------------------------------------------
  useEffect(() => {
    // Save the current body background color
    const originalBackgroundColor = document.body.style.backgroundColor;

    // Set the body background color to black
    document.body.style.backgroundColor = "#000";

    // Reset the body background color when the component unmounts
    return () => {
      document.body.style.backgroundColor = originalBackgroundColor;
    };
  }, []);
  // --------------------------------------------------------------
  return (
    <div className="login-parent">
      <div className="login-box-main">
        <div className="svg-container">
          <FieldDockLogo className="login-logo-svg" />
        </div>
        <div className="form-box-login">
          <form style={{ display: "flex", flexDirection: "column" }}>
            <label style={{ color: "#e8e8e8" }}>Enter Username</label>
            <input style={{ borderColor: "#e8e8e8" }} type="text" />
            <label style={{ color: "#e8e8e8" }}>Enter Password</label>
            <input style={{ borderColor: "#e8e8e8" }} type="password" />
            <button
              style={{ border: "1px solid orange", alignSelf: "center" }}
              type="submit"
            >
              Submit
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}
export default Imager_Settings;
